var size = flag.Int("s", 50000, "image size")

func readIn(vm *ngaro.NgaroVM) {
	r := bufio.NewReader(os.Stdin);
	b := make([]byte, 1);
	for {
		_, err := io.ReadAtLeast(r, b, 1);
		if err != nil {
			vm.Off <- true;
		}
		vm.In <- int(b[0]);
	}
}

func printOut(vm *ngaro.NgaroVM) {
	for {
		fmt.Print(string(<-vm.Out))
	}
}

